    t[332] = "This address will be saved to your Master addressbook. Select this option for addresses you wish to keep separate from the main router address book, but don't mind publishing.";
    t[333] = "\u0426\u044f \u0430\u0434\u0440\u0435\u0441\u0430 \u0431\u0443\u0434\u0435 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0430 \u0443 \u0432\u0430\u0448\u0456\u0439 \u0433\u043e\u043b\u043e\u0432\u043d\u0456\u0439 \u0430\u0434\u0440\u0435\u0441\u043d\u0456\u0439 \u043a\u043d\u0438\u0436\u0446\u0456. \u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u0446\u044e \u043e\u043f\u0446\u0456\u044e \u0434\u043b\u044f \u0430\u0434\u0440\u0435\u0441, \u044f\u043a\u0456 \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u0437\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u043e\u043a\u0440\u0435\u043c\u043e \u0432\u0456\u0434 \u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0457 \u0430\u0434\u0440\u0435\u0441\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430, \u0430\u043b\u0435 \u043d\u0435 \u043f\u0440\u043e\u0442\u0438 \u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0446\u0456\u0457.";
